import React from 'react';
import { Plus } from 'lucide-react';
import { ProductType } from '../types/productsType';

// Definir el producto con la imagen Base64
const producto: ProductType = {
  productId: 1,
  arqProductId: 'abc123',
  name: 'Producto Ejemplo',
  price: 19999,
  categoryId: 'cat1',
  category: 'Categor√≠a 1',
  quantity: 1,
  image: ''
};

interface ProductCardProps {
  product: ProductType;
  onAddToCart: (product: ProductType) => void;
  primaryColor: string;
}

export const ProductCard: React.FC<ProductCardProps> = ({ product, onAddToCart, primaryColor }) => {
  const formatPrice = (price: number) => {
    return new Intl.NumberFormat('es-CO', {
      style: 'currency',
      currency: 'COP',
      minimumFractionDigits: 0
    }).format(price);
  };

  return (
    <div className="bg-white rounded-lg shadow-md overflow-hidden hover:shadow-lg transition-shadow">
      <div className="aspect-w-16 aspect-h-9">
        <img
            src={
              producto.image
                ? `data:image/jpg;base64,${producto.image}`
                : 'public/omero.png' // Ruta relativa a la carpeta public
        }
          alt={product.name}
          className="w-full h-48 object-cover"
        />
      </div>
      
      <div className="p-4">
        <h3 className="font-semibold text-lg text-gray-900 mb-2">{product.name}</h3>
        
        <div className="flex justify-between items-center">
          <span className="text-xl font-bold text-gray-900">
            {formatPrice(product.price)}
          </span>
          
          <button
            onClick={() => onAddToCart(product)}
            className="text-white px-4 py-2 rounded-lg hover:opacity-90 transition-colors flex items-center space-x-2"
            style={{ backgroundColor: primaryColor }}
          >
            <Plus className="h-4 w-4" />
            <span>Agregar</span>
          </button>
        </div>
      </div>
    </div>
  );
};
